@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("revleft.com") {
     *.alt1, *.alt1Active {
     background-color: #03FB0B !important;
     border-color: black !important;
     }
     *.alt2, *.alt2Active {
     background-color: #FF00DE !important;
     }
     *.vbmenu_control {
     background-color: #FF00DE !important;
     border-color: black !important;
     border-width: 1px !important;
     border-style: solid;
     }
     *.page, *.tfoot {
     background-color: #FF00DE !important;
     }
     body {
     background-color: #FF00DE !important;
     }
     #tabsK ul li a {
     background: #03FB0B !important;
     border: 1px solid black !important;
     }
     #tabsK ul li a span{
     background: #03FB0B !important;
     padding: 4px !important;
     padding-left: 8px !important;
     padding-right: 8px !important;
     color: black !important;
     }
     img[src='revleft/statusicon/forum_old.gif'] {
        height: 0 !important;
	width: 0 !important;
	/* these numbers match the new image's dimensions */
	padding-left: 25px !important;
	padding-top: 26px !important;
	background: url(data:image/png;base64,) no-repeat !important;
     }
     img[src='revleft/statusicon/forum_new.gif'] {
        height: 0 !important;
	width: 0 !important;
	/* these numbers match the new image's dimensions */
	padding-left: 25px !important;
	padding-top: 26px !important;
	background: url(data:image/png;base64,) no-repeat !important;
     }
     img[src='revleft/misc/logo1.gif'] {
        height: 0 !important;
	width: 0 !important;
	/* these numbers match the new image's dimensions */
	padding-left: 205px !important;
	padding-top: 110px !important;
	background: url(data:image/png;base64,) no-repeat !important;

     }
}
